import React, { useState } from "react";

export default function App() {
  const [transcript, setTranscript] = useState("");
  const [manualPrompt, setManualPrompt] = useState("");
  const [generatedCode, setGeneratedCode] = useState("");
  const [compileOutput, setCompileOutput] = useState("");
  const [recording, setRecording] = useState(false);

  // Start Recording (placeholder â€” replace with real speech recognition)
  const handleStartRecording = () => {
    setRecording(true);
    setTimeout(() => {
      setTranscript("scroll down"); // example
      setRecording(false);
    }, 1500);
  };

  // Generate code from backend
  const handleGenerateCode = async () => {
    try {
      const promptToSend = transcript || manualPrompt;
      if (!promptToSend.trim()) return alert("Please enter a prompt");

      const res = await fetch("http://localhost:5000/api/generate-code", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ prompt: promptToSend }),
      });

      const data = await res.json();
      setGeneratedCode(data.code || "// No code generated");
    } catch (err) {
      console.error(err);
      setGeneratedCode("// Error generating code");
    }
  };

  // Compile code on backend
  const handleCompile = async () => {
    try {
      if (!generatedCode.trim()) return alert("No code to compile");

      const res = await fetch("http://localhost:5000/api/compile", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ code: generatedCode }),
      });

      const data = await res.json();
      setCompileOutput(data.output || "// No output returned");
    } catch (err) {
      console.error(err);
      setCompileOutput("// Error compiling code");
    }
  };

  return (
    <div className="min-h-screen bg-gray-100 p-6 flex flex-col items-center">
      <div className="w-full max-w-4xl bg-white rounded-lg shadow p-6 space-y-6">

        {/* Voice + Manual Input */}
        <div className="space-y-4">
          <button
            onClick={handleStartRecording}
            className="px-4 py-2 bg-blue-600 hover:bg-blue-700 text-white font-semibold rounded shadow"
          >
            {recording ? "ðŸŽ™ Recording..." : "ðŸŽ™ Start Recording"}
          </button>

          {/* Transcript */}
          <div>
            <label className="block text-gray-700 font-medium mb-1">
              Transcript:
            </label>
            <textarea
              value={transcript}
              onChange={(e) => setTranscript(e.target.value)}
              className="w-full border rounded p-2 focus:outline-none focus:ring-2 focus:ring-blue-400"
              rows={2}
            />
          </div>

          {/* Manual Prompt */}
          <div>
            <label className="block text-gray-700 font-medium mb-1">
              Or Enter Prompt Manually:
            </label>
            <input
              type="text"
              value={manualPrompt}
              onChange={(e) => setManualPrompt(e.target.value)}
              placeholder="Type your prompt if mic does not work..."
              className="w-full border rounded p-2 focus:outline-none focus:ring-2 focus:ring-blue-400"
            />
          </div>
        </div>

        {/* Generate Code */}
        <div className="space-y-4">
          <button
            onClick={handleGenerateCode}
            className="flex items-center gap-2 px-4 py-2 bg-green-600 hover:bg-green-700 text-white font-semibold rounded shadow"
          >
            âš¡ Generate Code
          </button>

          <div className="bg-gray-50 border rounded p-4">
            <h3 className="font-semibold text-gray-800 mb-2">ðŸ“„ Generated Code:</h3>
            <pre className="whitespace-pre-wrap text-sm text-gray-700">
              {generatedCode || "Your code will appear here."}
            </pre>
          </div>
        </div>

        {/* Compile & Save */}
        <div className="space-y-4">
          <button
            onClick={handleCompile}
            className="flex items-center gap-2 px-4 py-2 bg-purple-600 hover:bg-purple-700 text-white font-semibold rounded shadow"
          >
            ðŸ›  Compile & Save
          </button>

          <div className="bg-gray-50 border rounded p-4">
            <h3 className="font-semibold text-gray-800 mb-2">ðŸ–¥ Output:</h3>
            <pre className="whitespace-pre-wrap text-sm text-gray-700">
              {compileOutput || "Output will appear here."}
            </pre>
          </div>
        </div>
      </div>
    </div>
  );
}
